jQuery.fn.print=function(){if(this.size()>1){this.eq(0).print();return}else{if(!this.size()){return}}var d=$(this).closest("div.quintile-outer-container").find("div.jqplot-target");var e=d.jqplotToImageElemStr();var g=$("<div></div>").append($(this).closest("div.quintile-outer-container").find("table.stats-table").clone());var f=("printer-"+(new Date()).getTime());var h=$("<iframe name='"+f+"'>");h.css("width","1px").css("height","1px").css("position","absolute").css("left","-9999px").appendTo($("body:first"));var b=window.frames[f];var a=b.document;var c=$("<div>").append($("style").clone());a.open();a.write('<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">');a.write("<html>");a.write("<body>");a.write("<head>");a.write("<title>");a.write(document.title);a.write("</title>");a.write(c.html());a.write("</head>");a.write('<div class="quintile-outer-container ui-widget ui-corner-all">     <div class="quintile-content ui-widget-content ui-corner-bottom"> 		<table class="quintile-display">             <tr>                 <td class="chart-cell">');a.write(e);a.write('</td> <td class="stats-cell">');a.write(g.html());a.write("</td></tr></table></div></div>");a.write("</body>");a.write("</html>");a.close();setTimeout(function(){b.focus();b.print()},750);setTimeout(function(){h.empty();h.remove()},(60*1000))};